export default function App() {
  return (
    <View style={styles.container}>
      <StatusBar style="auto" />
      {/* <Navigator /> */}
      <Home/>
      
      {/* <Main/> */}
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
